import React from "react";
import { styled } from "styled-components";

export default function StackBox() {
  return <Container></Container>;
}

const Container = styled.div`
  width: 100%;
  height: 100%;
  display: grid;
  grid-template-columns: 1fr 3fr;
  background-color: wheat;
`;
